import React from 'react';
import { Button, Form } from 'react-bootstrap';

const UserSearch = ({ searchedMember, setSearchedMember, userList, searchUsers}) => {
	return (
		<div className="input-group mb-1">
	      <Form.Control // user search form
	        type="text"
	        placeholder="Search users..."
	        value={searchedMember}
	        onChange={(event) => setSearchedMember(event.target.value)} // when change input stage change temporary value
	      />
	      <Button className="button" onClick={searchUsers}>Search User</Button>
	      <ul>
	        {userList.map((user, index) => (
	          <li key={index}>{user.username}</li>
	        ))}
	      </ul>
    	</div>
	);
};

export default UserSearch;
